import React from 'react'

export default class DayDock extends React.Component{

    date = `${this.props.spotlight.split(' ')[0]} + ${this.props.spotlight.split(' ')[1]} + ${this.props.spotlight.split(' ')[2]}`

    render(){
        return <div className='daydock'>
            <h2>DayDock for {this.date}</h2>
        </div>
    }
}
